import React from 'react';

import './MenuBarStyle.css';
import { C_Icon } from '../Components';

export class MenuBar extends React.Component {
    constructor(props) {
        super(props);

    }
    render(){
        return (
            <div className="leftMenuBar blur">
    
                <div className="homeIcon">
                    <C_Icon icon="home" />
                </div>
    
                <div className="option">
                    <C_Icon onClick={()=>this.props.onClick()} icon="people" />
                </div>
    
            </div>
        )
    }
}
